import React from "react";

function ImagePopup({ card, onClose, item }) {
    const className = `${card ? 'popup_opened' : '' }`;
    // {cards.map((item) => {
    //     return item;
    // })}
    // console.log(item)

    return (
      <div className={`popup popup_type_more-image ${className}`}>
        <div className="popup__container-image">
        <img src={item.link} className="image" alt="Фото" />
          <button type="reset" className="popup__close" onClick={onClose}>
          </button>
          <p className="popup__title-image">{item.name}</p>
        </div>
      </div>
    );
}

export default ImagePopup;


